import React, { useRef, useState, useEffect } from 'react';
import { filter } from 'lodash';
import { Icon } from '@iconify/react';
import { sentenceCase } from 'change-case';
import plusFill from '@iconify/icons-eva/plus-fill';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
// material
import {
  Card,
  Table,
  Avatar,
  Button,
  Checkbox,
  TableRow,
  TableBody,
  TableCell,
  Container,
  Typography,
  TableContainer,
  TablePagination,
} from '@material-ui/core';
import Stack from '@mui/material/Stack';
// components
// import Page from '../components/Page';
 import Label from '../../views/material-kit/tables/Label';
import Scrollbar from '../../views/material-kit/tables/Scrollbar';
import USERLIST from '../../views/material-kit/tables/User';
import SearchNotFound from '../../views/material-kit/tables/SearchNotFound';
import UserListHead from '../../views/material-kit/tables/UserListHead';
import UserListToolbar from '../../views/material-kit/tables/UserListToolbar';
import UserMoreMenu from '../../views/material-kit/tables/UserMoreMenu';
import { Delete, Edit, Print } from '@material-ui/icons';
import { toast , ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
//

// ----------------------------------------------------------------------

const TABLE_HEAD = [
  { id: 'Map', label: 'Map', alignRight: false },
  { id: 'Code', label: 'Code', alignRight: false },
  { id: 'Name', label: 'Name', alignRight: false },
  { id: 'Price Group', label: 'Price Group', alignRight: false },
  { id: 'Phone', label: 'Phone', alignRight: false },
  { id: 'Email', label: 'Email', alignRight: false },
  { id: 'Address', label: 'Address', alignRight: false },

  { id: 'Actions', label: 'Actions', alignRight: false },



];

// ----------------------------------------------------------------------

let warehouse =[
  {"id":"1","Map":"blank","code":"111","Name":"4","Price_Group":"545","Phone":"878787458","Email":"test@123.com","Address":"fortune ambience"},
  {"id":"2","Map":"blank","code":"111","Name":"4","Price_Group":"545","Phone":"878787458","Email":"test@123.com","Address":"fortune ambience"},
  {"id":"3","Map":"blank","code":"111","Name":"4","Price_Group":"545","Phone":"878787458","Email":"test@123.com","Address":"fortune ambience"},
  {"id":"4","Map":"blank","code":"111","Name":"4","Price_Group":"545","Phone":"878787458","Email":"test@123.com","Address":"fortune ambience"},
  {"id":"5","Map":"blank","code":"111","Name":"4","Price_Group":"545","Phone":"878787458","Email":"test@123.com","Address":"fortune ambience"},
  {"id":"6","Map":"blank","code":"111","Name":"4","Price_Group":"545","Phone":"878787458","Email":"test@123.com","Address":"fortune ambience"},
]



const showtoast =(index)=>{
  toast.success(`Delete Successfully! no = ${index}`, {
    position: toast.POSITION.TOP_CENTER
});
}










function descendingComparator(a, b, orderBy) {
  if (b[orderBy] < a[orderBy]) {
    return -1;
  }
  if (b[orderBy] > a[orderBy]) {
    return 1;
  }
  return 0;
}

function getComparator(order, orderBy) {
  return order === 'desc'
    ? (a, b) => descendingComparator(a, b, orderBy)
    : (a, b) => -descendingComparator(a, b, orderBy);
}

function applySortFilter(array, comparator, query) {
  const stabilizedThis = array.map((el, index) => [el, index]);
  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });
  if (query) {
    return filter(array, (_user) => _user.name.toLowerCase().indexOf(query.toLowerCase()) !== -1);
  }
  return stabilizedThis.map((el) => el[0]);
}

function ListWareHouses(props) {
  // console.log(props.props.productlist);
  const [data, setdata] = useState([]);
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    // const response = axios.post('http://192.168.29.199:3000/api/public/Liststockproduct');
    // console.log(response);
    // setPosts(response);
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
    };
    fetch('http://143.205.125.69:3000/api/public/Liststockproduct', requestOptions)
      .then((response) => response.json())
      .then((data) => setdata(data.data.ListstockproductResponce));
  }, []);
  //
  const [page, setPage] = useState(0);
  const [order, setOrder] = useState('asc');
  const [selected, setSelected] = useState([]);
  const [orderBy, setOrderBy] = useState('name');
  const [filterName, setFilterName] = useState('');
  const [rowsPerPage, setRowsPerPage] = useState(5);

  const handleRequestSort = (event, property) => {
    const isAsc = orderBy === property && order === 'asc';
    setOrder(isAsc ? 'desc' : 'asc');
    setOrderBy(property);
  };

  const handleSelectAllClick = (event) => {
    if (event.target.checked) {
      const newSelecteds = data.map((n) => n.name);
      setSelected(newSelecteds);
      return;
    }
    setSelected([]);
  };

  const handleClick = (event, name) => {
    const selectedIndex = selected.indexOf(name);
    let newSelected = [];
    if (selectedIndex === -1) {
      newSelected = newSelected.concat(selected, name);
    } else if (selectedIndex === 0) {
      newSelected = newSelected.concat(selected.slice(1));
    } else if (selectedIndex === selected.length - 1) {
      newSelected = newSelected.concat(selected.slice(0, -1));
    } else if (selectedIndex > 0) {
      newSelected = newSelected.concat(
        selected.slice(0, selectedIndex),
        selected.slice(selectedIndex + 1)
      );
    }
    setSelected(newSelected);
  };

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
